import React from "react";

function Para() {
  return (
    <div>
      <p>Friends</p>
      <ul>
        <li>Varun</li>
        <li>Shulabh</li>
        <li>Wasim</li>
        <li>Pintu</li>
      </ul>
    </div>
  );
}
export default Para;
